import React from "react";
import { Todo } from "./model";
import "./Styles.css";

interface Props {
  todos: Todo[];
  setTodos: React.Dispatch<React.SetStateAction<Todo[]>>;
}
const TodoList: React.FC<Props> = ({ todos, setTodos }) => {
  return (
    <div >
      {todos.map((todo) => (
        <li key={todo.todo}>{todo.todo}</li>
      ))}
    </div>
  );
};

export default TodoList;
